import React, {useState, useEffect} from 'react'
import './bootstrap-5.2.1/dist/css/bootstrap.min.css';
import './jquery.js';
import './bootstrap-5.2.1/dist/js/bootstrap.min.js';

function Test(){
    const [data,setData]=useState([{}]);

    useEffect(()=>{
        fetch("/members").then(
            res=>res.json()
        ).then(
            data=>{   
                setData(data);
                console.log(data);
            }
        )
    },[])

    return (
        <div className="container d-flex justify-content-center border ">
            <div className="row row-cols-3">
                {(typeof data.members==="undefined")?(
                    <p className="bg-success">Loding......</p>
                ):(
                data.members.map((member,i)=>(
                    <p className="col col-3 btn btn-primary d-block m-3 " key={i}>{member}</p>
                ))
                )}
            </div>
        </div>
    )
    
}

export default Test;
